    //   datafiles
    function getData(power, angle, azimuth) {

        //readjsonfile


        var req = new XMLHttpRequest();
        req.open("GET", `data/${power}data.json`, false);
        req.send(null);
        let dataJson = JSON.parse(req.responseText);


        //find massive energie

        for (let i = 0; i < dataJson.length; i++) {

            if ((dataJson[i].angle == angle) && (dataJson[i].azimuth == azimuth)) {
                return (dataJson[i].energy); //return energy production
            };
        }
    };
    //  
    function getPowerMonth() {
        let power = document.getElementById("energymonth").value,
            powerArray = [];
        for (let i = 0; i < 12; i++) {
            powerArray.push(Number(power));

        };
        return powerArray;
    };

    function addHtml(data, container) {

        container.textContent = data;

    }

    function addOutputPrice(array, data) {
        for (let i = 0; i < array.length; i++) {
            array[i].textContent = data;

        }
    }

    function getDataPrice(index) {

        var req = new XMLHttpRequest();
        req.open("GET", "data/content.json", false);
        req.send(null);
        let dataJson = JSON.parse(req.responseText);

        return (dataJson[index]);

    }

