    function clickDesktop() {




        //  

        powerDataInput = $('input[name=datapower]:checked').val(), // 
            angleRoofInput = getConntainId('angleoutput').value, //   
            azimuthInput = getConntainId('azimuthoutput').value, //
            power = getData(powerDataInput, angleRoofInput, azimuthInput), // 
            powerMonth = getPowerMonth(), //   
            panelsOutput = getConntainId("panels"), //    - 
            panelsOutputPrice = getConntainId("panelsprice"), //     
            //powerMassivOutput = getConntainId("powermassiv"),
            areapanelsOutput = getConntainId("areabattery"), //    
            priceInstalOutput = getConntainId("instalation"),
            //     
            priceTransportOutput = getConntainId("pricetransport"),
            //     
            weightBatteryOutput = getConntainId("weightbattery"),
            //       
            powerConsumOutput = getConntainId("powerconsum"),
            powerinverterOutput = getConntainId("powerinverter"),
            summProjectOutput = getConntainId("summprojects"),
            investYearOutput = getConntainId("investyear"),
            powerYearOutput = getConntainId("summPowerYear"),

            invertorOutputPrice = getConntainSelector(".invertorprice"),
            //     
            priceCabelOutput = getConntainSelector(".cabelprice"),
            //     
            priceFixtureOutput = getConntainSelector(".fixtureprice"),
            //     
            priceConsumablesOutput = getConntainSelector(".consumables"),
            //     
            mainCostOutput = getConntainSelector(".maincost"),
            extendedCostOutput = getConntainSelector(".extcost"),

            // 
            financialOutput = getConntainClass("table__ceil-power"),
            financialOutputSumm = getConntainClass("table__ceil-power-year"),
            financialConsumOutput = getConntainClass("table__ceil-consum"),
            financialConsumOutputSumm = getConntainClass("table__ceil-consum-year"),
            financialResultOutput = getConntainClass("table__ceil-financial"),
            financialResultSumm = getConntainClass("table__ceil-financial-year"),
            outputMoneyYear = getConntainClass("table__ceil-output"),
            //dataPowerMes = getConntainClass("table__ceil-input-power"),

            batterySolar = getDataPrice(0), //  
            additional = getDataPrice(1), //  
            inverter = getDataPrice(2), // 
            panels = Math.ceil((powerDataInput * 1000) / batterySolar.power), // - 
            //powerMassiv = panels * powerDataInput, //   
            priceBattery = batterySolar.price, //    
            weightBattery = panels * batterySolar.weight, //   
            areaPanels = powerDataInput / 5 * 40, //   
            priceCabel = additional.cable * powerDataInput, //   
            fixturePrice = Math.ceil(panels / 2) * batterySolar.fixturePrice, //   
            priceInvertor = 0, // 
            powerMes = [],
            powerMonthFin = [],
            mainCostPrice = 0,
            summPowerYear = 0,
            investYear = 0,
            summProject = 0,


            //  
            outputPricePanel = panels * batterySolar.price,
            //   
            powerConsumPrice = 0,


            //     



            myProductionEnergy = [],
            allMonthEnergy = [],
            priceTransport = additional.transport * powerDataInput,
            // 

            priceConsumables = additional.consumables * powerDataInput;
        console.log(batterySolar.price);

        for (let i = 0; i < inverter.power.length; i++) {
            if (inverter.power[i] == powerDataInput)
                priceInvertor = inverter.price[i];
        }


        mainCostPrice = priceInvertor + outputPricePanel;
        extendedCostPrice = priceCabel + fixturePrice + priceConsumables
        priceInstall = (mainCostPrice + priceCabel + fixturePrice + priceConsumables) * 0.10;
        //   
        addOutputPrice(invertorOutputPrice, priceInvertor);
        addOutputPrice(priceCabelOutput, priceCabel);
        addOutputPrice(priceFixtureOutput, fixturePrice);
        addOutputPrice(priceConsumablesOutput, priceConsumables);

        addOutputPrice(mainCostOutput, mainCostPrice);
        addOutputPrice(extendedCostOutput, extendedCostPrice);




        //    
        if (powerMonth[0] <= 100)
            powerConsumPrice = (powerMonth[0] * batterySolar.tarif) / additional.course;
        else
            powerConsumPrice = ((100 * batterySolar.tarif) + ((powerMonth[0] - 100) * batterySolar.tarif_ext)) / additional.course;




        summProject = priceBattery * panels + priceInvertor + priceCabel + priceInstall + priceConsumables + priceTransport + fixturePrice;

        //    
        for (let i = 0; i < financialOutput.length; i++) {
            financialOutput[i].textContent = power[i];

        }
        //   
        for (let i = 0; i < financialConsumOutput.length; i++) {
            financialConsumOutput[i].textContent = powerMonth[0];

        }
        financialResultYear = 0;
        //   
        for (let i = 0; i < financialResultOutput.length; i++) {
            if ((Number(financialConsumOutput[i].textContent) > (Number(financialOutput[i].textContent)))) {
                financialResultOutput[i].textContent = 0;
            } else {
                let temporary = ((power[i] - powerMonth[0]) * batterySolar.greentarif * batterySolar.cross) + powerConsumPrice;
                financialResultOutput[i].textContent = temporary.toFixed(2);
                financialResultYear = financialResultYear + Number(temporary.toFixed(2));
            }

        }



        for (let i = 0; i < power.length; i++) {

            summPowerYear = summPowerYear + Number(power[i]);
        };


        financialOutputSumm[0].textContent = summPowerYear.toFixed(0);
        financialConsumOutputSumm[0].textContent = powerMonth[0] * 12;
        financialResultSumm[0].textContent = financialResultYear.toFixed(2);


        //    
        investYear = Number(summProject) / Number(financialResultYear);




        // - 
        addHtml(panels, panelsOutput);
        addHtml(powerDataInput, powerinverterOutput);

        //  
        addHtml(areaPanels.toFixed(2), areapanelsOutput);
        // 

        //   
        addHtml(summProject, summProjectOutput);
        //  

        //  
        addHtml(outputPricePanel, panelsOutputPrice);

        //  - 
        addHtml(priceCabel, priceCabelOutput);

        //  

        addHtml(priceInvertor, invertorOutputPrice);
        //  
        addHtml(fixturePrice, priceFixtureOutput);
        //   
        addHtml(priceConsumables, priceConsumablesOutput);
        //   
        addHtml(priceInstall.toFixed(2), priceInstalOutput);
        //  
        addHtml(priceTransport, priceTransportOutput);
        //  
        addHtml(weightBattery, weightBatteryOutput);
        //   



        addHtml(investYear.toFixed(1), investYearOutput);








        // 
        highChart(power, powerMonth);

        $(".button__topdf").css("display", "flex")

    };





